import { GET_MOVIE_API } from '../constants/GetMovieConstants';

const initialState = {
    movieList: []
}

export default (state = initialState, action) => {
    switch (action.type) {

        case GET_MOVIE_API:
            state.movieList = action.movieList;
            return { ...state }

        default:
            return state
    }
}
